import React from 'react';

export default class CommentItem extends React.Component {



    render() {
        return (
            <li>
                <div>
                    <p>
                        <span>
                            {this.props.comment.user}
                        </span>
                        <span>says:</span></p>
                        <p>
                        {this.props.comment.context}
                    </p>
                </div>
            </li>
        )
    }
}
